import React from "react";
import Link from "next/link";

const Navbar = () => {
  return (
    <React.Fragment>
      <div>
        <ul>
          <li>
            <Link href={"/"}>
              <a>Home</a>
            </Link>
          </li>
          <li>
            <Link href={"/about"}>
              <a>About</a>
            </Link>
          </li>
        </ul>
      </div>

      <style jsx>{`
        div {
          border: 1px solid tomato;
          height: 45px;
          background: grey;
        }

        ul {
          list-style: none;
          height: 45px;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        li {
          align-self: center;
        }

        a {
          text-decoration: none;
          color: yellow;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Navbar;
